contracts/Remittance.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract Remittance {
    address public owner;

    event Sent(address indexed from, address indexed to, uint256 amount);

    constructor() {
        owner = msg.sender;
    }

    // Gửi tiền cho người nhận
    function send(address payable _to) public payable {
        require(msg.value > 0, "Phai gui mot luong CELO lon hon 0");
        _to.transfer(msg.value);
        emit Sent(msg.sender, _to, msg.value);
    }

    // Rút tiền (nếu bạn muốn có ví trung gian)
    function withdraw(address payable _to, uint256 _amount) public {
        require(msg.sender == owner, "Chi chu so huu moi duoc rut");
        require(address(this).balance >= _amount, "Khong du tien");
        _to.transfer(_amount);
    }

    // Xem số dư contract
    function getBalance() public view returns (uint256) {
        return address(this).balance;
    }

    receive() external payable {}
}

